import axios from "axios";

const rootURL = "http://localhost:7071//users/";

let testUrl = () => {
    try{
        let pobj = axios.get(rootURL);
        return pobj;
    }
    catch(exception){
        console.log(rootURL + ": not correct " + (exception));
    }
}

let createUser = () => {
    try{
        const json = JSON.stringify(
        {
            "type": "ADMIN",
            "id": 1,
            "userName": "istayfly",
            "password": "word",
            "bookOnHold": null,
            "books": null
        });

        let pobj = axios.post(rootURL + "save", json);
        return pobj;
    }
    catch(exception){
        console.log(rootURL + "save : not correct " + (exception));
    }
}

export {testUrl, createUser};
